import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent {
  title = 'frontend';
}
<nav class="navbar navbar-expand-sm bg-primary navbar-dark">
  <ul class="navbar-nav">
    <li class="nav-item">
      <a [routerLink]="['/employees']" routerLinkActive="router-link-active" class="nav-link" > Employee List</a>
    </li>
    <li class="nav-item">
      <a [routerLink]="['/create-employee']" routerLinkActive="router-link-active" > Add Employee </a>
    </li>

  </ul>
</nav>


<h1 class="text-center">{{ title }}</h1>
<div class="container">
  <router-outlet></router-outlet>
</div>
